import {BrowserRouter, Switch, Route} from 'react-router-dom';
import './styles/App.css';
import Login from '../pages/Login';
import Home from '../pages/Home';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path='/' component={Login} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
